-- ----------------------------
-- Table structure for tasktype_info
-- ----------------------------
DROP TABLE IF EXISTS `tasktype_info`;
CREATE TABLE `tasktype_info`  (
  `id` bigint(20) NOT NULL,
  `task_type_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '检修任务类别名【里程检、登顶检、均衡修、季节专检】',
  `mileage_period` int(11) NULL DEFAULT NULL COMMENT '里程周期',
  `time_period` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '时间周期。因为有绝对时间这种情况，故时间周期选用字符串，后端处理具体逻辑',
  `be_absolute_time` int(1) NULL DEFAULT NULL COMMENT '是否为绝对时间，0表示相对时间，1表示绝对时间（通常季节专检有绝对时间，例如 4-30; 10-30 表示4月30日之前 和 10月30日之前 ）若为绝对时间，则时间周期字段为若干时间节点字符串的拼接',
  `be_multi_mode` int(11) NULL DEFAULT NULL COMMENT '是否为多修程，0表示单修程，1表示多修程。多修程才能适配服役月份',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

